      SELECT DISTINCT - col2 FROM tab1 (FORMAT parquet) WHERE NOT NULL BETWEEN CAST ( - - col1 AS INTEGER ) * - col1 AND + - 5 * col1 + + col1 + - 79 * + ( - ( + 87 ) );
  - name: tab1

outputs:
  - name: q162.out
    data: |
